class Solution {
    public double findMedianSortedArrays(int[] A, int[] B) {
        List<Integer> aMedian = new ArrayList<>(Arrays.asList(A));
        aMedian.add(0, B[0]);
        aMedian = aMedian.stream().toList();
        List<Integer>.Comparator<Integer> aComparator = aMedian::compareTo;

        Collections.sort(aMedian, aComparator);

        int[] left = aMedian.subList(0, Math.floor(aMedian.size() / 2)).toArray();
        int[] right = new int[] {0};

        return (left[0] + right[0]).doubleValue() / 2.0;
    }
